import React,{useState, useEffect} from 'react'
import Spinner from './Spinner.js';
import './Home.scss'

function Home() {
  const [loading, setLoading] = useState(true);
  useEffect(()=>{
    setLoading(false);
   });



  return (

    <div>
      <h1>WELCOME TO EUNMI's PORTFOLIO</h1>
      {loading ? (<PetsIcon/>) : 
      (<FormControlLabel
      control={<Checkbox 
        icon={<FavoriteBorder />} 
        checkedIcon={<Favorite />} 
        name="checkedH" />}
        label="PET!"
      />
    )}
    </div>
  )
}

export default Home
